import logo from './logo.svg';
import './App.css';

const App = () => {
  return (
    <div className="App">
      <ul>
        <li>
          html
        </li>
        <li>
          css
        </li>
        <li>
          javascript
        </li>
        <li>
          React
        </li>
      </ul>
    </div>
  );
}

export default App;
